import React from 'react';
import './JumboBanner.css';

const JumboBanner = () => {
  return (
    <div className="JumboBanner">
      <h1>Arizona's Quality Shop since 1979</h1>
      <h2><a href={"call"}>602-944-5210</a></h2>
    </div>
  );
}

export default JumboBanner;
